import React from 'react';

const InputBox = (arrayMarcas) => (
  <nav id="menu">
    <ul>
      {arrayMarcas.map((item) => (
        <li>
          {item}
        </li>
      ))}
    </ul>
  </nav>
);

export default InputBox;
